-- ----------------------------
-- Table structure for rpa_panel_task_detail
-- ----------------------------
DROP TABLE IF EXISTS `rpa_panel_task_detail`;
CREATE TABLE `rpa_panel_task_detail`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'id',
  `task_id` bigint NOT NULL COMMENT '任务ID',
  `task_status` varchar(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '任务执行状态',
  `task_progress` float NULL DEFAULT 0 COMMENT '任务执行进度',
  `task_version` bigint NOT NULL COMMENT '任务版本号',
  `task_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '任务名称',
  `line_list_json` json NULL COMMENT 'easy-flow的线段信息',
  `node_list_json` json NULL COMMENT 'easy-flow的节点信息',
  `user_id` int NOT NULL COMMENT '创建任务的用户ID',
  `task_permission` tinyint NULL DEFAULT 0 COMMENT '任务权限状态',
  `task_creation_time` date NULL DEFAULT NULL COMMENT '任务创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `task_id_index`(`task_id`) USING BTREE,
  INDEX `user_id_index`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 35 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = 'rpa面板任务详情表' ROW_FORMAT = DYNAMIC;

